import React from 'react';

const Dropdown = ({options}) => {
    const renderOptions = options.map((option) => {
        return (
            <div key={option.value} className="item">
                {option.label}
            </div>
        )
    })

    return (
        <div>Dropdown</div>
    );
}

export default Dropdown;
